css:
atom-text-editor,
:host {
  background-color: #2d2d2d;
  color: #cccccc;
}
atom-text-editor .line.cursor-line,
:host .line.cursor-line {
  background-color: rgba(255, 255, 255, 0.04);
}
atom-text-editor .cursor,
:host .cursor {
  border-left: 2px solid #b3b3b3;
}
atom-text-editor .invisible,
:host .invisible {
  color: #cccccc;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #393939;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #515151;
}
atom-text-editor .bracket-matcher .region,
:host .bracket-matcher .region {
  border-bottom: 1px solid #b3b3b3;
  box-sizing: border-box;
  background-color: #393939;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #393939;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #393939;
}
atom-text-editor .gutter,
:host .gutter {
  color: #cccccc;
  background-color: #393939;
  border-right: 2px solid #515151;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #515151;
  color: #cccccc;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #cccccc;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #999999;
}
atom-text-editor .scroll-view,
:host .scroll-view {
  padding-left: 10px;
}
.comment {
  color: #999999;
}
.entity.name.type {
  color: #ffcc66;
}
.entity.name.function {
  color: #6699cc;
}
.entity.name.class,
.entity.name.type.class {
  color: #ffcc66;
}
.entity.name.section {
  color: #6699cc;
}
.entity.name.tag {
  color: #f2777a;
}
.entity.other.attribute-name {
  color: #f99157;
}
.entity.other.attribute-name.id {
  color: #6699cc;
}
.entity.other.inherited-class {
  color: #f2777a;
}
.keyword {
  color: #cc99cc;
}
.keyword.control {
  color: #cc99cc;
}
.keyword.operator {
  color: #cccccc;
}
.keyword.other.special-method {
  color: #6699cc;
}
.keyword.other.unit {
  color: #f99157;
}
.storage {
  color: #cc99cc;
}
.constant {
  color: #f99157;
}
.constant.character.escape {
  color: #66cccc;
}
.constant.numeric {
  color: #f99157;
}
.constant.other.color {
  color: #66cccc;
}
.constant.other.symbol {
  color: #99cc99;
}
.variable {
  color: #f2777a;
}
.variable.interpolation {
  color: #ee484c;
}
.variable.parameter.function {
  color: #cccccc;
}
.invalid.illegal {
  background-color: #f2777a;
  color: #2d2d2d;
}
.string {
  color: #99cc99;
}
.string.regexp {
  color: #66cccc;
}
.string.regexp .source.ruby.embedded {
  color: #f99157;
}
.string.other.link {
  color: #f2777a;
}
.punctuation.definition.comment {
  color: #999999;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #cccccc;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #6699cc;
}
.punctuation.definition.bold {
  color: #ffcc66;
  font-style: bold;
}
.punctuation.definition.italic {
  color: #cc99cc;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #ffcc66;
  background-color: rgba(255, 204, 102, 0.07);
}
.support.class {
  color: #ffcc66;
}
.support.function {
  color: #6699cc;
}
.support.function.any-method {
  color: #6699cc;
}
.meta.class {
  color: #ffcc66;
}
.meta.link {
  color: #f99157;
}
.meta.require {
  color: #6699cc;
}
.meta.selector {
  color: #cc99cc;
}
.meta.separator {
  background-color: #393939;
  color: #cccccc;
}
.none {
  color: #cccccc;
}
.markup.bold {
  color: #f99157;
  font-style: bold;
}
.markup.changed {
  color: #cc99cc;
}
.markup.deleted {
  color: #f2777a;
}
.markup.italic {
  color: #cc99cc;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #6699cc;
}
.markup.inserted {
  color: #99cc99;
}
.markup.list {
  color: #f2777a;
}
.markup.quote {
  color: #f99157;
}
.markup.raw.inline {
  color: #99cc99;
}
.coffee.keyword.operator {
  color: #66cccc;
}
.coffee.variable.assignment {
  color: #f99157;
}
.coffee.meta.brace.square {
  color: #6699cc;
  background-color: rgba(102, 153, 204, 0.07);
}
.coffee.meta.brace.curly {
  color: #f2777a;
  background-color: rgba(242, 119, 122, 0.07);
}
.coffee.meta.brace.round {
  color: #66cccc;
  background-color: rgba(102, 204, 204, 0.07);
}
.coffee.punctuation.definition.string {
  color: #99cc99;
  background-color: rgba(153, 204, 153, 0.07);
}
.gfm {
  -webkit-font-smoothing: auto;
}
.gfm .marker {
  color: #f2777a;
}
.gfm .bold {
  color: #ffcc66;
  font-style: bold;
}
.gfm .italic {
  color: #cc99cc;
  font-style: italic;
}
.gfm .quote {
  color: #99cc99;
}
.gfm .list {
  color: #66cccc;
}
.gfm .link {
  color: #6699cc;
}
.gfm .link .entity {
  color: #cccccc;
}
.gfm .link .begin,
.gfm .link .end {
  background-color: rgba(102, 153, 204, 0.07);
}
.gfm .raw {
  color: #adadad;
}
.gfm .hr {
  background-color: #393939;
  color: #cccccc;
}
.haml.punctuation.definition.tag {
  color: #f2777a;
}
.ruby.constant.other.symbol {
  color: #f99157;
}
.ruby.punctuation.definition.variable {
  color: #f2777a;
}
.ruby.punctuation.separator.other {
  color: #66cccc;
}
.ruby.keyword.operator.assignment {
  color: #66cccc;
}
.ruby.keyword.operator.comparison {
  color: #66cccc;
}
.ruby.punctuation.separator.inheritance {
  color: #66cccc;
}
.ruby.keyword.operator.logical {
  color: #66cccc;
}
.ruby.keyword.operator.arithmetic {
  color: #66cccc;
}
.ruby.variable.other.constant {
  color: #ffcc66;
}
.ruby.variable.other.instance {
  color: #f2777a;
}
.ruby.variable.parameter.function {
  color: #f99157;
}
.ruby.variable.other.block {
  color: #cccccc;
}
.ruby.punctuation.separator.variable {
  color: #66cccc;
}
.ruby.punctuation.section.array {
  color: #6699cc;
  background-color: rgba(102, 153, 204, 0.07);
}
.ruby.punctuation.section.scope {
  color: #f2777a;
  background-color: rgba(242, 119, 122, 0.07);
}
.ruby.punctuation.section.regexp {
  color: #66cccc;
  background-color: rgba(102, 204, 204, 0.07);
}
.ruby.punctuation.definition.string {
  color: #99cc99;
  background-color: rgba(153, 204, 153, 0.07);
}
.ruby.punctuation.definition.parameters {
  color: #66cccc;
  background-color: rgba(102, 204, 204, 0.07);
}
.ruby.punctuation.section.function {
  color: #66cccc;
  background-color: rgba(102, 204, 204, 0.07);
}
.js.constant.other.property {
  color: #cccccc;
}
.js.keyword.operator {
  color: #66cccc;
}
.js.variable {
  color: #cccccc;
}
.js.variable.class {
  color: #f2777a;
}
.js.variable.language.this {
  color: #f2777a;
}
.js.support.constant {
  color: #cccccc;
}
.js.support.object {
  color: #ffcc66;
}
.js.support.variable {
  color: #ffcc66;
}
.js.meta.brace.square {
  color: #6699cc;
  background-color: rgba(102, 153, 204, 0.07);
}
.js.meta.brace.curly {
  color: #f2777a;
  background-color: rgba(242, 119, 122, 0.07);
}
.js.meta.brace.round {
  color: #66cccc;
  background-color: rgba(102, 204, 204, 0.07);
}
.js.punctuation.separator.key-value {
  color: #66cccc;
}
.js.punctuation.definition.string {
  color: #99cc99;
  background-color: rgba(153, 204, 153, 0.07);
}
.js.punctuation.definition.parameters {
  color: #66cccc;
  background-color: rgba(102, 204, 204, 0.07);
}
.js.punctuation.definition.arguments {
  color: #66cccc;
  background-color: rgba(102, 204, 204, 0.07);
}
.jsx.punctuation.definition.tag {
  color: #cccccc;
  background-color: rgba(204, 204, 204, 0.07);
}
.angular .entity.other.attribute-name {
  color: #f99157 !important;
}
.angular .punctuation.definition.block {
  color: #ffcc66 !important;
  background-color: rgba(255, 204, 102, 0.07);
}
.html .meta.tag.sgml.doctype {
  color: #cc99cc;
}
.html .punctuation.definition.string {
  color: #99cc99;
  background-color: rgba(153, 204, 153, 0.07);
}
